import React from "react";
import "./Header.css";

const Header = ({ isLoggedIn, setLoggedIn, inputValue}) => {
  const handleLogin = () => {
    setLoggedIn(true);
  };

  return (
    <div className="header">
      <p>dashboard</p>
      {isLoggedIn ? (
        <p>{inputValue}</p>
      ) : (
        <p>First login please</p>
      )}
    </div>
  );
};

export default Header;
